import React from 'react'
import styles from '../modules/task.module.css'

const TaskComponent = ({
    list, 
    item
}) => {
  return (
    <div className={styles.container}>
        <div className={styles.item}>item.name</div>
        <button className={styles.delete}></button>
    </div>
  )
}

export default TaskComponent
